import React from "react";

//material-ui
import { Grid } from '@material-ui/core'

export const Card = () => {
  return (
    <Grid
      item
      style={{ height: "50vh", padding: "10px", backgroundColor: "red" }}
      md={6}
    >
      <div
        style={{
          width: "100%",
          height: "100%",
          backgroundColor: "rgba( 0 , 0 , 34 , 1 )",
        }}
        className="container"
      ></div>
    </Grid>
  );
};
